import React from "react";
import '../styles/Home.css';


function Home() {
    return (
        <div className="Container">
            <div className="content">
                <p>Welcome to FitnessTrack, your one stop shop for everything fitness related. </p>
            </div>
            <div className="bigLogo">
                <a>Logo Here</a>
            </div>
        </div>
    );

}

export default Home;
